import React, { Component } from 'react';
import Calendar from 'react-calendar';
 
class MyCalendar extends Component {
  state = {
    date: new Date(),
  }
 
  onChange = date => this.setState({ date })
 
  render() {
    return (
      <div class="calendar">
	<h1 class="month"></h1>
	<p class="day"></p>
</div>
    );
  }
}export default MyCalendar;
